{{- if .Values.consoleLink.enabled }}
apiVersion: console.openshift.io/v1
kind: ConsoleLink
metadata:
  name: {{ include "rag-llm-frontend.fullname" . }}
spec:
  applicationMenu:
    section: RAG LLM Demo UI
    imageURL: data:image/png;base64,
  href: {{ printf "https://%s.%s" (include "rag-llm-frontend.fullname" .) .Values.global.localClusterDomain }}
  location: ApplicationMenu
  text: 'RAG LLM Demo UI'
{{- end }}
